//npm start
import React from 'react';

const Main = () => {
    return (
        <React.Fragment>
            <main className="main">
                <div>
                    Малюнок
                </div>
                <div>ava+description</div>
                <div>mi post</div>
                <div>new post</div>
                Main content
            </main>
        </React.Fragment>
    );
}

export default Main;
